import React from 'react';

// Styles
import './header.styles.scss';

// Components
import Navigation from '../navigation/navigation.component';

const Header = () => (
    <header>
        <Navigation />
        <h1>Benvenuti in Bigiu</h1>
    </header>
)

export default Header;
